    value: The check from Robinson For Congress.Com dated March 30, 2013 in the amount
      of $215.00 was received and deposited into the federal account on May 6, 2013.  The
      expenditures for Generic Telemarketing Prospect Donors and Generic Donor Direct
      Mail Expense were solicitations of contributions for party fundraising. The
      expenditures to Neopost were for postage on the postage meter which is used
      in the office. The travel expense reimbursements were mileage reimbursements
      to staff members for travel throughout the state. The payment to FLS Connect
      was for robo calls made before the election for which we are getting invoiced
      on a monthly basis. The allocation of salaries was for employees who spend less
      than 25 percent of their time on federal election activities.  The additional
      transfer of $926.73 from the nonfederal account on May 14, 2013 was for allocable
      expenses paid in April which is within the 60 day period after payment was made
      from the federal account. Some of the amounts reimbursed to staff members do
      not print on the FEC report because the vendors are below the $200 per year
      itemization level.
